import React from "react";
import { MDBListGroup, MDBListGroupItem } from 'mdb-react-ui-kit';

function ArchiveList(props) {

  const tasks = props.archiveTasks;
  const ArchiveList = ({ tasks }) => {
    const listStyle = {
      minWidth: '22rem',
      listStyleType: 'disc', // or 'circle'
    };}

  function createTaskList() {
    return (
      <div className="h-95 p-5 bg-body-tertiary border rounded-3 mt-2">
        <h3 className="archive-list-title">Archive Lists</h3>
        <p>Good Job!</p>
        <MDBListGroup style={listStyle}  light small className="archive-list">
      {tasks.map((task, index) => (
        <MDBListGroupItem key={index}>{task}</MDBListGroupItem>
      ))}
    </MDBListGroup>
      </div>
    );
  }

  return createTaskList();
}

export default ArchiveList;
